import { useState } from "react";
import "./App.css";

function App() {
  const [todos, setTodos] = useState([
    {
      id: Math.random(),
      text: "Learn JS",
      isComplated: false,
    },
    {
      id: Math.random(),
      text: "Learn React",
      isComplated: false,
    },
    {
      id: Math.random(),
      text: "Learn English",
      isComplated: false,
    },
  ]);

  return <div className="App">Hello Armenia</div>;
}

export default App;
